    {ntt"total": 16,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-12-09T02:44:52.774445",nt"name": "mnhacoe-army-corps-sediment-data-from-maine-and-new-hampshire-acquired-in-1994",nt"isopen":
    false,nt"url": null,nt"notes": "The data in this layer are from a study
    that evaluated and documented the historic and projected future dredging and dredged
    material disposal needs of the coastal rivers and harbors of the states of Maine
    and New Hampshire. Documentation of historic dredging and disposal activities was
    accomplished through the collection of data primarily from the files of the ACOE,
    New England Division, in Waltham, Massachusetts, supplemented by information from
    the states of Maine and New Hampshire and previously published reports. This historic
    dredging occurred between 1950-1993 and involved 499 dredging events.",nt"license_title":
